Ann Marie Rios, Avy Scott, Betty Sinclair, Cherokee, Felix Vicious, Gen Padova, Holly Hollywood, Kelli Tyler, Ramona Luv, Pason, Simone Pryce

AVN Top 500 Award winning director James Avalon gives us a behind-the-scenes look into the ultra-glam life of a super-nude model Nadine (Ann Marie). Watch as an obsessed documentary film-maker interviews Nadine's closest friends and associates, staging a series of erotic encounters portraying the mysterious brunette at her sensual best. Avalon gives Babes Illustrated an unexpected twist, kind of like two gorgeous bikini-clad beauties bathing on a snowy beach!
